// chapters.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { ChevronDown, ChevronUp, User } from 'lucide-react';

const ChaptersPage = () => {
  const navigate = useNavigate();

  // Assume the logged in user's subject is stored in localStorage (e.g., from signup/update-details)
  const userSubject = localStorage.getItem('subject') || 'Mathematics';

  // Simulated chapters data.
  // In a real application, you might fetch this from your Flask backend which reads the file structure.
  const [chaptersData, setChaptersData] = useState({});

  useEffect(() => {
    const data = {
      'Mathematics': [
        {
          chapterName: 'Algebra',
          topics: [
            'Linear Equations',
            'Quadratic Equations',
            'Polynomials',
            'Exponents',
            'Logarithms'
          ]
        },
        {
          chapterName: 'Geometry',
          topics: [
            'Triangles',
            'Circles',
            'Polygons',
            'Angles',
            'Coordinate Geometry'
          ]
        },
        {
          chapterName: 'Calculus',
          topics: [
            'Limits',
            'Derivatives',
            'Integrals',
            'Series',
            'Multivariable Calculus'
          ]
        }
      ]
      // Additional subjects can be added here if needed.
    };

    setChaptersData(data);
  }, []);

  // Keep track of which chapter is expanded
  const [expandedChapter, setExpandedChapter] = useState(null);

  const handleChapterClick = (index) => {
    setExpandedChapter(expandedChapter === index ? null : index);
  };

  const handleTopicClick = (chapterName, topic) => {
    // Navigate to the topic page.
    // You can pass parameters via the URL; here we use a simple route structure.
    navigate(`/topic/${userSubject}/${chapterName}/${topic}`);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-500 to-purple-600 text-white p-6">
      <Header />
      <div className="mt-16">
        <h2 className="text-4xl font-bold mb-8 text-center">
          Chapters for {userSubject}
        </h2>
        <div className="max-w-3xl mx-auto">
          {chaptersData[userSubject] ? (
            chaptersData[userSubject].map((chapter, index) => (
              <div key={index} className="mb-4">
                <motion.div
                  whileHover={{ scale: 1.02 }}
                  onClick={() => handleChapterClick(index)}
                  className="flex justify-between items-center bg-white bg-opacity-20 p-4 rounded-lg cursor-pointer"
                >
                  <h3 className="text-2xl">{chapter.chapterName}</h3>
                  {expandedChapter === index ? <ChevronUp /> : <ChevronDown />}
                </motion.div>
                {expandedChapter === index && (
                  <motion.div
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    className="mt-2 ml-4"
                  >
                    {chapter.topics.map((topic, idx) => (
                      <motion.div
                        key={idx}
                        whileHover={{ scale: 1.02 }}
                        onClick={() => handleTopicClick(chapter.chapterName, topic)}
                        className="bg-white bg-opacity-20 p-3 rounded-lg my-1 cursor-pointer"
                      >
                        {topic}
                      </motion.div>
                    ))}
                  </motion.div>
                )}
              </div>
            ))
          ) : (
            <p>No chapters found for this subject.</p>
          )}
        </div>
      </div>
    </div>
  );
};

const Header = () => {
  const navigate = useNavigate();
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const handleProfileClick = () => {
    setDropdownOpen(!dropdownOpen);
  };

  const handleLogout = () => {
    // Clear user session data (adjust keys as per your implementation)
    localStorage.removeItem('user');
    localStorage.removeItem('subject');
    navigate('/login');
  };

  const handleProfilePage = () => {
    // Navigate to the profile page (to be implemented)
    navigate('/profile');
  };

  return (
    <div className="flex justify-end items-center relative">
      <div className="cursor-pointer" onClick={handleProfileClick}>
        <User size={40} className="text-white" />
      </div>
      {dropdownOpen && (
        <div className="absolute right-0 mt-2 w-48 bg-white text-purple-600 rounded shadow-lg z-10">
          <div
            className="px-4 py-2 hover:bg-gray-200 cursor-pointer"
            onClick={handleProfilePage}
          >
            Profile
          </div>
          <div
            className="px-4 py-2 hover:bg-gray-200 cursor-pointer"
            onClick={handleLogout}
          >
            Logout
          </div>
        </div>
      )}
    </div>
  );
};

export default ChaptersPage;
